import './Nav.css'
import Logo from '../../Logo.png'
import NavItem from '../navItem/NavItem'

const Nav = () => {

    const navbarItem = ["Home","Men's", "Women's","Kid's","Pages","Features","Explore"]
  return (
    <div class="nav-container">
    <div class="nav">
      <div class="nav-brand">
        <img src={Logo} />
      </div>
      <ul class="navbar-nav">
        navbarItem.forEach( item =>{
            <NavItem><a href="#" class="nav-link">{el}</a></NavItem>
        }})
        // <NavItem><a href="#" class="nav-link">Home</a></NavItem>
        // <NavItem><a href="#" class="nav-link">Men's</a></NavItem>
        // <NavItem><a href="#" class="nav-link">Women's</a></NavItem>
        // <NavItem><a href="#" class="nav-link">Kid's</a></NavItem>
        // <NavItem><a href="#" class="nav-link select-icon ">Pages</a></NavItem>
        // <NavItem><a href="#" class="nav-link select-icon ">Features</a></NavItem>
        // <NavItem><a href="#" class="nav-link">Explore</a></NavItem>
      </ul>
    </div>
  </div>
  )
}

export default Nav
